import "./InputLabel.css";

interface InputLabelProps {
  htmlFor: string;
  children: React.ReactNode;
}

const InputLabel: React.FC<InputLabelProps> = ({ htmlFor, children }) => {
  return (
    <label className="input-label" htmlFor={htmlFor}>
      {children}
    </label>
  );
};

export default InputLabel;
